import React from 'react';

class BooleanLogic extends React.Component{
	constructor(props){
		super(props)
	}


	render(){
		return (
			<div>
				welcome to <b>boolean logic</b>! our goal for this page is for you to understand what <b>2B||!2B</b> means! 
				<br/>
				we are going to learn how to make our <b>if statements</b> more complex so that we can check multiple things at once (<b className="note">psst. need a reminder</b> on what in the world if statements are? check out the <b className="pageName">if statements page</b>!). and of course, as the name suggests, we are going to work with <b>booleans</b>! (<b className="note">btw:</b> throwback to the <b className="pageName">variables page</b>... a <b>boolean</b> is a variable type that has only two possible values: <b>true</b> or <b>false</b>.) 
				<br/>
				are you ready for a bunch of fun symbols like <b>!</b>, <b>&&</b>, <b>||</b>, and <b>()</b>? are you ready for tons of tables filled with <b>true</b> and <b>false</b>? cool. let's do this.
				<h3>! = not</h3>

				<h3>&& = and</h3>

				<h3>|| = or</h3>

				<h3>() = first</h3>

				<h3>the big reveal</h3>
				hamlet once said <b>2B||!2B</b>, that is the question...
				<h3>isRecapTime = true && true || !true</h3>
				<b>awesome!</b> you made it to recap!
				<br/><br/>
				...we know <b className="note">just for java</b> is as <b>addicting</b> as the newest Netflix binge, so what are you waiting for? <b className="pageName">keep coding!</b>
			</div>
		)
	}
}

export default BooleanLogic;
